import React, { Component } from 'react';


class Navbar extends Component{
    render(){
        return(
                <div>
                 	<header class="header">
		<h1 class="logo">covid-counter</h1>
      <ul class="main-nav">
          <li>Home</li>
          <li>About</li>
          <li>Portfolio</li>
          <li>Contact</li>
      </ul>
	</header> 

                </div>

        )
    }
}



export default Navbar;
